clear all; close all; clc;

%% ============================================================
% 1) Chargement du signal propre
% =============================================================
data = load('fcno03fz.mat');
s = data.fcno03fz(:);
N = length(s);
fs = 8000;

%% ============================================================
% 2) Création du signal bruité (exemple : RSB = 10 dB)
% =============================================================
RSB_in = 10;                          % choisir 5 ou 15 aussi
s_power = mean(s.^2);                 % puissance du signal propre

b = randn(N,1);                       % bruit blanc
b_power = mean(b.^2);
b = b * sqrt( s_power / (b_power * 10^(RSB_in/10)) );

y = s + b;                            % signal bruité

%% ============================================================
% 3) Décomposition en trames
% =============================================================
N_t = 256;                            % taille trame
overlap = 0.5;
step = round(N_t * (1 - overlap));
w = hamming(N_t);

idx = 1:step:(N - N_t + 1);
nb_frames = length(idx);

% stockage
frames_s  = zeros(N_t, nb_frames);
frames_y  = zeros(N_t, nb_frames);

for k = 1:nb_frames
    frames_s(:,k) = s(idx(k):idx(k)+N_t-1) .* w;
    frames_y(:,k) = y(idx(k):idx(k)+N_t-1) .* w;
end

%% ============================================================
% 4) Estimation du bruit (méthode simple : moyennage des premières trames)
% =============================================================
Nb_noisy_frames = 6; % nombre de trames considérées comme bruit seul (à adapter)
noise_psd = zeros(N_t,1);

for k = 1:Nb_noisy_frames
    Yk = fft(frames_y(:,k));
    noise_psd = noise_psd + abs(Yk).^2;
end
noise_psd = noise_psd / Nb_noisy_frames;

%% ============================================================
% 5) Traitement par soustraction spectrale trame par trame
% =============================================================
frames_clean = zeros(N_t, nb_frames);

for k = 1:nb_frames
    
    % FFT de la trame bruitée
    Yk = fft(frames_y(:,k));
    
    % Module et phase
    magY = abs(Yk);
    phaseY = angle(Yk);
    
    % Soustraction spectrale
    magS_est = magY.^2 - noise_psd;
    
    % Half-wave rectification
    magS_est(magS_est < 0) = 0;
    
    % Reconstruction complexe
    Sk = sqrt(magS_est) .* exp(1j*phaseY);
    
    % IFFT = trame rehaussée
    frames_clean(:,k) = real(ifft(Sk));
end

%% ============================================================
% 6) AFFICHAGE : représentation temporelle et spectrale d'une trame
% =============================================================
f = (0:N_t-1)*(fs/N_t);
k_plot = 20; % trame choisie pour illustration

figure; %[output:620a8723]
subplot(3,1,1) %[output:620a8723]
plot(frames_s(:,k_plot), 'LineWidth', 1.5) %[output:620a8723]
title('Trame ORIGINALE (temps)') %[output:620a8723]
grid on %[output:620a8723]

subplot(3,1,2) %[output:620a8723]
plot(frames_y(:,k_plot), 'r', 'LineWidth', 1.5) %[output:620a8723]
title('Trame BRUITÉE (temps)') %[output:620a8723]
grid on %[output:620a8723]

subplot(3,1,3) %[output:620a8723]
plot(frames_clean(:,k_plot), 'g', 'LineWidth', 1.5) %[output:620a8723]
title('Trame REHAUSSÉE (temps)') %[output:620a8723]
grid on %[output:620a8723]

%% Spectres
S = abs(fft(frames_s(:,k_plot)));
Y = abs(fft(frames_y(:,k_plot)));
C = abs(fft(frames_clean(:,k_plot)));

figure; %[output:54136407]
plot(f, S, 'b', 'LineWidth', 1.2); hold on; %[output:54136407]
plot(f, Y, 'r', 'LineWidth', 1.2); %[output:54136407]
plot(f, C, 'g', 'LineWidth', 1.2); %[output:54136407]
legend('Original','Bruité','Rehaussé'); %[output:54136407]
title('Spectres d''amplitude des trois signaux'); %[output:54136407]
xlabel('Fréquence (Hz)'); %[output:54136407]
grid on %[output:54136407]


%% ============================
% 2. AJOUT DE BRUIT POUR UN RSB DONNÉ
% =============================
RSB_dB = 5;          % RSB avant traitement : tu peux changer 5, 10, 15 dB
P_signal = mean(s.^2);
P_bruit = P_signal / (10^(RSB_dB/10));
sigma_b = sqrt(P_bruit);

b = sigma_b * randn(N,1);
y = s + b;           % signal bruité

%% ============================
% 3. PARAMÈTRES DE LA STFT
% =============================
N_t = 256;              % taille des trames
recouvrement = 0.5;
step = N_t * (1 - recouvrement);
fenetre = hamming(N_t);

% indices des trames
starts = 1:step:(N - N_t + 1);
nb_frames = length(starts);

%% ============================
% 4. TRAITEMENT SPECTRAL PAR SOUSTRACTION SPECTRALE
% =============================

% estimation DSP du bruit (on prend les 20 premières trames supposées silencieuses)
B = y(1:20*N_t);
DSP_bruit = mean(abs(fft(reshape(B,N_t,20))).^2,2);

% initialisation trames rehaussées
frames_clean_est = zeros(N_t, nb_frames);

for k = 1:nb_frames

    % ======== EXTRACTION ========
    idx = starts(k);
    s_frame = s(idx:idx+N_t-1) .* fenetre;
    y_frame = y(idx:idx+N_t-1) .* fenetre;

    % ======== FFT ========
    S = fft(s_frame);
    Y = fft(y_frame);

    % ======== SOUSTRACTION SPECTRALE ========
    Py = abs(Y).^2;
    P_est = max(Py - DSP_bruit, 0);        % half-wave rectification
    S_est = sqrt(P_est) .* exp(1j * angle(Y));

    % ======== SAUVEGARDE ========
    frames_clean_est(:,k) = real(ifft(S_est));
end

%% ============================
% 5. AFFICHE TRAME PAR TRAME
% =============================
% On affiche uniquement la 50e trame (par exemple)
k = 50;

idx = starts(k);

s_frame = s(idx:idx+N_t-1) .* fenetre;
y_frame = y(idx:idx+N_t-1) .* fenetre;
s_est_frame = frames_clean_est(:,k);

% FFT (une seule trame)
S = fft(s_frame);
Y = fft(y_frame);
S_est = fft(s_est_frame);

f = (0:N_t-1)*(Fe/N_t); %[output:229475b1]

%% ============================
% 6. FIGURE : SIGNAUX TEMPORELS
% =============================
figure;
plot(s_frame, 'b', 'LineWidth',1.2); hold on;
plot(y_frame, 'r', 'LineWidth',1.2);
plot(s_est_frame, 'g', 'LineWidth',1.2);

title("Trame n°"+k+" — temporel");
legend("Parole propre","Parole bruitée","Parole rehaussée");
grid on;

%% ============================
% 7. FIGURE : SPECTRES D'AMPLITUDE
% =============================
figure;
plot(f, abs(S), 'b', 'LineWidth',1.2); hold on;
plot(f, abs(Y), 'r', 'LineWidth',1.2);
plot(f, abs(S_est), 'g', 'LineWidth',1.2);

title("Spectres d'amplitude — trame n°"+k);
legend("Spectre propre","Spectre bruité","Spectre rehaussé");
xlabel("Fréquence (Hz)");
grid on;

